import React from 'react';

const Dashboard = () => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <h1 className="text-2xl font-semibold text-gray-700">Welcome to the Dashboard</h1>
    </div>
  );
};

export default Dashboard;
